//Init
let candle = record.current
let lookback = 10
let normLookback = 20
let learning_rate = 0.0001
let iterations = 1000
let lambda = 0
let dim = 2
let theta = [0, 0]

//creating a price array
let src = candle.close
variable.srcArray.push(src)
if (variable.srcArray.length > normLookback) { variable.srcArray.splice(0, 1) } //normLookback

//creating a synthetic price array
let srcSynth = Math.log(Math.abs(src ** 2 - 1) + 0.5)
variable.srcSynthArray.push(srcSynth)
if (variable.srcSynthArray.length > normLookback) { variable.srcSynthArray.splice(0, 1) } //normLookback

if (variable.srcArray.length === normLookback) {
	//Creating matrix for training
	//only using the last @param:lookback amount of values
	let trainMatrix = []
	for (var i = 0; i < lookback; i++) {
		trainMatrix.push([variable.srcArray.slice(-lookback)[i], variable.srcSynthArray.slice(-lookback)[i]])
	}

	//Training the model
	let model = train(trainMatrix)

	//array of model cost
	variable.costArray.push(model.cost)
	if (variable.costArray.length > normLookback) { variable.costArray.splice(0, 1) }

	//Price normalization of model cost
	variable.normCost = priceNorm(variable.costArray, Math.max(...variable.srcArray), Math.min(...variable.srcArray))

	//Getting prediction for current prices
	let prediction = predict(trainMatrix[trainMatrix.length - 1])

	//Array of predictions
	variable.predArray.push(prediction)
	if (variable.predArray.length > normLookback) { variable.predArray.splice(0, 1) }

	//Price normalization of predictions
	variable.normPred = priceNorm(variable.predArray, Math.max(...variable.srcArray), Math.min(...variable.srcArray))

} else {
	variable.normCost = 0
	variable.normPred = 0
}

//FUNCTIONS 
//
//Min Max Normalization
function priceNorm(values, max, min) {
	let hi = Math.max(...values)
	let lo = Math.min(...values)

	if (isNaN((max - min) * (values[values.length - 1] - lo) / (hi - lo))) {
		return min
	} else {
		return (max - min) * (values[values.length - 1] - lo) / (hi - lo) + min
	}
}

//Training model
//Logistic regression with gradient descent
//output gives theta, threshold and cost
function train(data) {
	var N = data.length
	var X = []
	var Y = []
	for (var i = 0; i < N; ++i) {
		var row = data[i]
		var x_i = []
		var y_i = row[row.length - 1]
		x_i.push(1.0)

		for (var j = 0; j < row.length - 1; ++j) {
			x_i.push(row[j])
		}
		X.push(x_i)
		Y.push(y_i)
	}

	//Running gradient descent
	for (var iter = 0; iter < iterations; ++iter) {
		var theta_delta = gradient(X, Y, theta)
		for (var d = 0; d < dim; ++d) {
			theta[d] = theta[d] - learning_rate * theta_delta[d]
		}
	}

	//Getting threshold
	let threshold = computeThreshold(X, Y)

	return {
		theta: theta,
		threshold: threshold,
		cost: cost(X, Y, theta)
	}
}

//calculate threshold for model
function computeThreshold(X, Y) {
	var threshold = 1,
		N = X.length;
	for (var i = 0; i < N; ++i) {
		var prob = predict(X[i])
		if (Y[i] === 1 && threshold > prob) {
			threshold = prob
		}
	}
	return threshold
}

//calculate gradient for model
function gradient(X, Y, theta) {
	var N = X.length
	var Vx = [];
	for (var d = 0; d < dim; ++d) {
		var sum = 0.0

		for (var i = 0; i < N; ++i) {
			var x_i = X[i]
			var predicted = h(x_i, theta)
			sum += ((predicted - Y[i]) * x_i[d] + lambda * theta[d]) / N
		}
		Vx.push(sum)
	}

	return Vx
}

//calculate hypothesis for model
function h(x_i, theta) {
	var gx = 0.0
	for (var d = 0; d < dim; ++d) {
		gx += theta[d] * x_i[d]
	}

	// Because IEEE 754
	if (gx > 36) {
		gx = 36
	}

	return 1.0 / (1.0 + Math.exp(-gx))
}

//calculate cost for model
function cost(X, Y, theta) {
	var N = X.length
	var sum = 0
	for (var i = 0; i < N; ++i) {
		var y_i = Y[i]
		var x_i = X[i]
		sum += -(y_i * Math.log(h(x_i, theta)) + (1 - y_i) * Math.log(1 - h(x_i, theta))) / N
	}

	//Regularize using lambda, lambda = 0 => no regularization
	for (var d = 0; d < dim; ++d) {
		sum += (lambda * theta[d] * theta[d]) / (2.0 * N)
	}

	return sum
}

//calculate predition after model has been trained
function predict(X) {
	if (X[0].length) { // x is a matrix            
		var predicted_array = []
		for (var i = 0; i < X.length; ++i) {
			var predicted = predict(X[i])
			predicted_array.push(predicted)
		}

		return predicted_array
	}
	var x_i = []
	x_i.push(1.0)
	for (var j = 0; j < X.length; ++j) {
		x_i.push(X[j])
	}

	return h(x_i, theta)
}

