//Z-Normalization
function zNormalization(values) {
	let len = values.length
	let sum = 0
	let SQ = 0

	for (var i = 0; i < len; i++) {
		sum += values[i]
	}
	let MA = sum / len

	for (var i = 0; i < len; i++) {
		SQ += (values[i] - MA) ** 2
	}
	let sigma = Math.sqrt(SQ / len)

	if (isNaN((values[values.length - 1] - MA) / sigma)) {
		return 1
	} else {
		return (values[values.length - 1] - MA) / sigma
	}
}

